Utilizzo della PET in oncologia:
La PET in Oncologia (in English: Oncology) ha le seguenti indicazioni: Stadiazione (in English: TNM staging system) e ristadiazione a fine terapia;
monitoraggio delle terapie antineoplastiche;
diagnosi differenziale fra benignità o malignità delle lesioni;
ricerca di tumori primitivi occulti (tumori che hanno già dato metastasi, ma che hanno origine sconosciuta);
ricerca del miglior punto di una lesione da cui effettuare una Biopsia (in English: Biopsy);
caratterizzazione metabolica delle lesioni neoplastiche;
pianificazione di trattamenti Radioterapia (in English: Radiation therapy).

Slang:
Il termine slang indica un insieme di parole ed espressioni che non appartengono al Lessico (in English: Lexicon) standard di un Dialetto (in English: Dialect) o di una Lingua (linguistica) parlata, distinto dal linguaggio tecnico di una particolare professione o da un Pidgin (in English: Pidgin) e che risponde ad almeno due delle seguenti caratteristiche: abbassare, anche temporaneamente, il tono di un Registro (linguistica) (in English: Register) formale;
essere familiare, come Significato (in English: Signifié), ai parlanti e comune a un determinato Gruppo sociale (in English: Social group);
sostituire un Sinonimia (in English: Synonymy) noto e convenzionalmente accettato, ma il cui utilizzo è ritenuto, per la sua convenzionalità, fastidioso.

Trivio:
