la registrazione di Atto giuridico (in English: legal act);
Tributo (in English: Tribute) autoliquidati collegati alla Successione (diritto) (in English: Heritance and succession law);
Somme accertate Conservatorie;
Depositi per rilascio certificati;
Certificazione/Formalità/Ispezione Ipoteca (in English: Hypothec);
i pagamenti relativi ad attività del Agenzia del Demanio (in English: Agenzia del demanio);
i pagamenti relativi ad attività delle Dogana (in English: Customs).
